style.css:
@-moz-document domain("www.nitrotype.com")
{
  body
  {
    background-color: #808080;
    overflow-y: scroll;
    background: none;
    overflow-x: hidden;
    position: relative;
  }

  .card--grit
  {
    background-image: url("https://www.nitrotype.com/uploads/newsimage/205/1593635290.png");
    background: fixed;
  }

  html
  {
    background: fixed url("https://www.nitrotype.com/uploads/newsimage/205/1593635290.png") no-repeat, #808080;
    box-sizing: border-box;
    color: #80808000;
    font-family: "Montserrat", sans-serif;
    font-size: 16px;
    font-weight: 300;
    line-height: 1.6;
    background-size: 120%;
  }

  .bg--gradient
  {
    background: fixed;
  }

  .card--a
  {
    background-image: url("https://www.nitrotype.com/cars/97_large_1.png");
    color: #808080;
    background-size: 100%;
  }

  .btn--primary
  {
    background: #0c0c0c;
    color: #ffffff;
  }

  .theme--pDefault .profile-title
  {
    color: #FFFFFF;
    text-shadow: 0 2px 2px rgba(2, 2, 2, 0.25);
  }

  .theme--pDefault .profile-levelNum
  {
    color: #FFFFFF;
    text-shadow: 0 2px 2px rgba(2, 2, 2, 0.25);
  }

  .tc-t
  {
    color: #ffffff;
  }

  .theme--pDefault .profile-body
  {
    color: #FFFFFF;
  }
}

@-moz-document domain(nitrotype.com)
{


  .dash-copyContainer
  {
    background: #1d1e23;
    -webkit-box-shadow: 0px 1px 157px 10px rgba(0,0,0,0.78);
    box-shadow: 0px 1px 157px 10px rgba(0,0,0,0.78);
    border-radius: 5px;
    flex: 1;
    overflow: hidden;
    padding: 15px;
    display: flex;
  }

  .dash-copy
  {
    color: #00abff;
    font-family: "Roboto Mono", "Courier New", Courier, "Lucida Sans Typewriter", "Lucida Typewriter", monospace;
    font-size: 28px;
  }

  ::selection
  {
    background-color: #1976c6;
    color: white;
  }

  .bg--gradient
  {
    background: fixed;
  }

  .theme--pDefault .profile-bg
  {
    background: url("https://www.nitrotype.com/uploads/newsimage/205/1593635290.png") top left repeat, linear-gradient(0deg, #808080 60%, #ffffff 100%);
    color: #d3d3d3;
  }

  .btn--inky, .btn--inky:focus:not(:hover)
  {
    color: #ffffff;
  }

  .theme--pDefault .profile-bgHead
  {
    background: url("https://www.nitrotype.com/uploads/newsimage/205/1593635290.png") top left repeat, linear-gradient(0deg, #808080 10%, #ffffff 100%);
  }

  .theme--pDefault.is-gold .profile-bg
  {
    background: url("https://www.nitrotype.com/uploads/newsimage/205/1593635290.png") top left repeat, linear-gradient(0deg, #80808000 10%, #ffffff 100%);
  }

  .theme--pDefault.is-guest .profile-bgHead
  {
    background: #fff0;
  }
}
